import React from 'react';
import './App.css';
import{Link} from 'react-router-dom';
import style from './sucre.module.css'

function MenuList({name, desc, image, price}) {
    return (
        <div className="menu-list">
            <div className="">
                <div className="menu-img">
                    <img src={image}/>
                </div>
                <div>
                    <div className="menu-text">
                        <h4>{name} </h4>
                        <p>{desc}</p>
                    </div>
                    <div className="menu-price">
                        <p>{price}</p>
                        <a>Add to cart</a>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default MenuList;
